                <div className="col-lg-4">
                    <div className="card mb-4 shadow-sm">
                        <img src="https://www.themoviedb.org/t/p/w300_and_h450_bestv2/lJA2RCMfsWoskqlQhXPSLFQGXEJ.jpg"/>
                    </div>
                </div>
            </div>
        )
    }
}

export default MovieList;
